const quizForm = document.getElementById("quizForm");
const resultDiv = document.getElementById("result");
const resultText = document.getElementById("resultText");
const downloadBtn = document.getElementById("downloadBtn");

function renderQuestions() {
  questions.forEach((q, index) => {
    const div = document.createElement("div");
    div.className = "question-block";
    div.innerHTML = `<h3>${index + 1}. ${q.text}</h3>`;
    q.options.forEach((opt, optIndex) => {
      const id = `q${index}_opt${optIndex}`;
      div.innerHTML += `
        <label>
          <input type="radio" name="q${index}" value="${opt.type}" required />
          ${opt.text}
        </label>
      `;
    });
    quizForm.appendChild(div);
  });

  const submitBtn = document.createElement("button");
  submitBtn.type = "submit";
  submitBtn.textContent = "Lihat Hasil";
  quizForm.appendChild(submitBtn);
}

quizForm.addEventListener("submit", function (e) {
  e.preventDefault();
  const formData = new FormData(quizForm);
  const scores = { visual: 0, auditory: 0, kinesthetic: 0 };

for (let pair of formData.entries()) {
  const value = pair[1];
  if (scores.hasOwnProperty(value)) {
    scores[value]++;
  }
}


// Hitung total jawaban
const totalAnswers = Object.values(scores).reduce((sum, val) => sum + val, 0);

// Hitung persentase untuk setiap gaya belajar
const percentages = {
  visual: Math.round((scores.visual / totalAnswers) * 100),
  auditory: Math.round((scores.auditory / totalAnswers) * 100),
  kinesthetic: Math.round((scores.kinesthetic / totalAnswers) * 100),
};

// Cari nilai skor tertinggi
const maxScore = Math.max(...Object.values(scores));

// Ambil semua tipe yang punya skor tertinggi (bisa 1 atau lebih)
const dominantTypes = Object.keys(scores).filter(
  (type) => scores[type] === maxScore
);

let result = "";

// Tambahkan bagian persentase ke hasil
result += `Persentase Gaya Belajar Anak:\n`;
result += `- Visual: ${percentages.visual}%\n`;
result += `- Auditori: ${percentages.auditory}%\n`;
result += `- Kinestetik: ${percentages.kinesthetic}%\n\n`;

// Jika hanya satu tipe dominan
if (dominantTypes.length === 1) {
  const type = dominantTypes[0];
  result += `Gaya belajar anak Anda cenderung **${capitalize(type)}**.\n\n`;
  result += getDescription(type);
} else {
  result += `Gaya belajar anak Anda menunjukkan kecenderungan yang **seimbang** antara beberapa tipe:\n\n`;
  dominantTypes.forEach((type) => {
    result += getDescription(type) + "\n\n";
  });
}

// Fungsi penjelasan gaya belajar
function getDescription(type) {
  if (type === "visual") {
    return `Visual:
Anak mudah belajar melalui gambar, warna, dan penglihatan.
Tips: Gunakan flashcard, video edukatif, gambar, dan mindmap.`;
  } else if (type === "auditory") {
    return `Auditori:
Anak mudah belajar dengan mendengarkan.
Tips: Gunakan lagu pembelajaran, ceritakan materi, rekam suara untuk diulang.`;
  } else if (type === "kinesthetic") {
    return `Kinestetik:
Anak suka menyentuh, bergerak, dan praktik langsung.
Tips: Gunakan permainan peran, eksperimen, dan kegiatan fisik.`;
  }
}

// Fungsi bantu kapitalisasi
function capitalize(str) {
  return str.charAt(0).toUpperCase() + str.slice(1);
}

resultText.textContent = result;
resultDiv.style.display = "block";

});

